import React, { useState } from "react";
import { QrReader } from "react-qr-reader";
import { useFormik } from "formik";
import * as Yup from "yup";
import { Grid, makeStyles } from "@material-ui/core";
import { Alert, Button, Modal, Box } from "@mui/material";
import Spinner from "../common/spinner/Spinner";
import service from "../../service";
import styled from '@emotion/styled';


const style = {
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  width: 400,
  bgcolor: "background.paper",
  border: "2px solid #000",
  boxShadow: 24,
  p: 1,
};

const QrButton = styled.a`
 background: linear-gradient(to right,#103160 ,#19437e);
 background-color: #103160;
 color: #fff;
 font-family: Verdana;
 font-size: 18px;
 font-weight: 800;
 font-style: normal;
 text-decoration: none;
 padding: 50px 55px;
 border: 0px solid #000;
 border-radius: 12px;
 display: inline-flex;
 justify-content: center;
 align-items: center;
 flex-flow: column;
 cursor: pointer;

span{
 margin-bottom:40px;
 display: block;
 width: 150px;
 height: 150px;
 background-image: url(data:image/png;base64,);
 background-repeat: no-repeat;
 background-size: contain;
 transform: rotate(0deg);
}
:hover{
 background: linear-gradient(to right,hsl(215, 72%, 27%) ,hsl(215, 67%, 35%));
 background-color: #525d7a;
}
:active{
 transform: scale(.99);
}
  
`;


const styles = makeStyles((theme) => ({
  marginTextField: {
    marginBottom: "1rem",
  },
  marginCard: {
    margin: '1rem',
  },
  marginDiv: {
    padding: "1rem 5rem",
    maxHeight: "100vh",
  },
  alert: {
    maxWidth: "100%",
    marginBottom: "2rem",
  },
  form: {
    padding: "2rem 4rem",
    border: "2px solid #F8F9F9",
    borderRadius: "10px",
    background: "#F8F9F9",
    maxHeight: "100%",
  },
}));

//FindClient
const validationSchemaFindClient = Yup.object({
  clientId: Yup.number()
    .typeError("Necesitas agregar un numero de cliente")
    .required("El número de cliente es obligatorio"),
});
//

const RetirarEfectivo = (props) => {
  const [openQrReader, setopenQrReader] = useState(false);
  const handleOpenQrReader = () => setopenQrReader(true);
  const handleCloseQrReader = () => setopenQrReader(false);

  const [data, setData] = useState("No result");
  const [showSpinner, setShowSpinner] = useState(false);
  const [msg, setMsg] = useState({ show: false, txt: null, type: null });

  const classes = styles();

  //FindClient
  const formikFindClient = useFormik({
    initialValues: {
      clientId: "",
    },
    validationSchema: validationSchemaFindClient,
    onSubmit: (values, { resetForm }) => {
      findClient(values, resetForm);
    },
  });
  const findClient = async ({ clientId }, resetForm) => {
    const { developURL } = service;
    const token = localStorage.getItem("t");
    const url = `${developURL}/client/${clientId}`;
    const fetchConfig = {
      method: "GET",
      headers: { "Content-Type": "application/json", Authorization: token },
    };
    try {
      setShowSpinner(true);
      const response = await fetch(url, fetchConfig);
      const jsonResponse = await response.json();
      setShowSpinner(false);
      console.log(jsonResponse);
      if (!jsonResponse.success) {
        changeMsg("error", "No se encontró una cuenta");
        return;
      }
      let client = jsonResponse.result;
      if (!client.state) {
        changeMsg("error", "La cuenta se encuentra desactivada");
      } else if (!client.active) {
        changeMsg("error", "El cliente se encuentra desactivada");
      } else {
        //setCanDeposit(true);
        resetForm();
      }
    } catch (error) {
      setShowSpinner(false);
      changeMsg("error", "Algo salio mal... Intentelo mas tarde!");
    }
  };
  //

  const changeMsg = (type, txt) => {
    setTimeout(() => {
      setMsg({ show: true, type, txt });
    }, 0);
    setTimeout(() => {
      setMsg({ ...msg, show: false });
    }, 3000);
  };

  return (
    // grid container mui
    <Grid container
    spacing={0}
    align="center"
    justify="center">
      <Box>
      <QrButton onClick={handleOpenQrReader}><span></span>Escaner QR</QrButton>
        <Modal
          open={openQrReader}
          onClose={handleCloseQrReader}
          aria-labelledby="modal-modal-title"
          aria-describedby="modal-modal-description"
        >
          <Box sx={style}>
            {openQrReader && (
              <QrReader
                onResult={(result, error) => {
                  if (!!result) {
                    setData(result?.text);
                  }

                  if (!!error) {
                    console.info(error);
                  }
                }}
                videoContainerStyle={{ paddingTop: "75%" }}
              />
            )}
            {showSpinner && <Spinner />}
            {msg.show && (
              <Alert className={classes.alert} severity={msg.type} fullWidth>
                {" "}
                {msg.txt}{" "}
              </Alert>
            )}
          </Box>
        </Modal>
      </Box>
    </Grid>
  );
};

export default RetirarEfectivo;
